import React from "react";

function HomePage() {
  return (
    <React.Fragment>
      <div>
        <img
          src="images/LandingImage.png"
          alt="Medic"
          style={{ height: "100vh", width: "100%" }}
        ></img>
        <img
          src="https://i.pinimg.com/originals/09/8a/78/098a78706d066533ee5a3fb19094f963.gif"
          alt="loading..."
          style={{ height: "100vh", position: "absolute" }}
        />
      </div>
    </React.Fragment>
  );
}

export default HomePage;
